import React, { Component } from 'react';

import logo from '.../Assets/logo.svg';
import heartOn from './Assets/heart-on.png';
import heartOff from './Assets/heart-off.png';
import starOn from './Assets/star-on.png';
import starOff from './Assets/star-off.png';
import responseBubble from './Assets/response-bubble.png';

import './App.css';
import SamDialogue from './Components/Dialogue/SamDialogue';
import UserDialogue from './Components/Dialogue/UserDialogue';

class MainDialogue extends Component {
  render() {
    return (
        <div>
          <div className="Dialogue-main">
            <div className="Side-bar-container">
              <div className="Side-bar" id="Hearts-bar">
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
              </div>
              <div className="Side-bar" id="Stars-bar">
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
              </div>
            </div>
            <div className="Box">
              <div className="Box-content">
                  <SamDialogue dialogue="Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi."/>
                  <UserDialogue dialogue="Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi."/>
